import React from 'react';
import { Swiper, SwiperSlide } from 'swiper/react';
import { Pagination, Navigation } from 'swiper/modules';
import { useState } from 'react';
import 'swiper/css';
import 'swiper/css/pagination';
import 'swiper/css/navigation';

function AdminUpdateModalEditImage() {
    const clubImages = [
        "http://res.cloudinary.com/defq71a8p/image/upload/v1690274453/zd6d4satgsidaeaxc8ue.jpg",
        "http://res.cloudinary.com/defq71a8p/image/upload/v1690274453/b4fjbdhmkdmsq2ffehgi.jpg",
        "http://res.cloudinary.com/defq71a8p/image/upload/v1690274453/nvkoyua56tumstmtmntn.jpg",
        "http://res.cloudinary.com/defq71a8p/image/upload/v1690373093/t5hz1iea4blg5hlqkdv4.jpg"
    ]
    return (
        <div className='container-md'>
            <Swiper
                pagination={{
                    type: 'progressbar',
                }}
                navigation={true}
                modules={[Pagination, Navigation]}
                className="mySwiper"
            >
                {
                    clubImages.map((img, index) => (
                        <SwiperSlide className='aspect-w-16 aspect-h-9 relative '>
                            <img className='object-cover w-full bbq' src={img} />
                            <a className='hidden bbq-hover:flex btn w-20 h-4 btn-error absolute inset-0 m-auto items-center justify-center'>
                                <svg width="15" height="15" viewBox="0 0 15 15" fill="none" xmlns="http://www.w3.org/2000/svg"><path d="M12.8536 2.85355C13.0488 2.65829 13.0488 2.34171 12.8536 2.14645C12.6583 1.95118 12.3417 1.95118 12.1464 2.14645L7.5 6.79289L2.85355 2.14645C2.65829 1.95118 2.34171 1.95118 2.14645 2.14645C1.95118 2.34171 1.95118 2.65829 2.14645 2.85355L6.79289 7.5L2.14645 12.1464C1.95118 12.3417 1.95118 12.6583 2.14645 12.8536C2.34171 13.0488 2.65829 13.0488 2.85355 12.8536L7.5 8.20711L12.1464 12.8536C12.3417 13.0488 12.6583 13.0488 12.8536 12.8536C13.0488 12.6583 13.0488 12.3417 12.8536 12.1464L8.20711 7.5L12.8536 2.85355Z" fill="currentColor"></path></svg>
                            </a>
                        </SwiperSlide>
                    ))
                }
            </Swiper>
        </div>
    )
}

export default AdminUpdateModalEditImage
